<body class="bg-gray-100 text-gray-800">
    <div class="container mx-auto p-4 sm:p-6 lg:p-8">
        <header class="text-center mb-10"><h1 class="text-5xl font-bold text-gray-900">Mi Catálogo de Productos</h1></header>
        <div id="category-filters-viewer" class="flex flex-wrap justify-center gap-2 mb-8"></div>
        <main id="product-gallery-viewer" class="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-8"></main>
        <footer class="text-center mt-12 text-gray-500"><p>Catálogo</p></footer>
    </div>
    <script>
        document.addEventListener('DOMContentLoaded', () => {
            const data = window.CATALOG_DATA;
            const products = data.p;
            const exchangeRate = data.r;
            let currentCategoryFilter = 'all';
            const gallery = document.getElementById('product-gallery-viewer');
            const filters = document.getElementById('category-filters-viewer');

            function renderViewerProducts() {
                const filtered = currentCategoryFilter === 'all' ? products : products.filter(p => p.category === currentCategoryFilter);
                gallery.innerHTML = filtered.map(product => {
                    const isSoldOut = product.quantity <= 0;
                    const priceCUP = (product.price * exchangeRate).toFixed(2);
                    const message = encodeURIComponent('Hola, estoy interesado en el producto: ' + product.name);
                    const whatsappLink = 'https://wa.me/' + product.phone + '?text=' + message;
                    return `
                    <div class="bg-white rounded-2xl shadow-lg overflow-hidden flex flex-col">
                        <div class="relative">
                            <img src="${product.imageUrl}" alt="${product.name}" class="w-full h-56" style="aspect-ratio: 1 / 1; object-fit: cover;">
                            ${isSoldOut ? `<div style="position:absolute;inset:0;background-color:rgba(0,0,0,0.5);display:flex;align-items:center;justify-content:center;"><span style="color:white;font-weight:bold;font-size:1.25rem;border:2px solid white;padding:0.5rem 1rem;border-radius:0.25rem;">AGOTADO</span></div>` : ''}
                        </div>
                        <div class="p-5 flex flex-col flex-grow">
                            <p class="text-xs font-semibold text-indigo-600 uppercase">${product.category}</p>
                            <h3 class="text-xl font-semibold text-gray-900 mt-1">${product.name}</h3>
                            <p class="text-gray-600 mt-2 flex-grow">${product.description.replace(/</g, "&lt;").replace(/>/g, "&gt;")}</p>
                            <p class="text-3xl font-bold text-gray-800 mt-4">$ ${product.price.toFixed(2)} <span class="text-base font-medium text-gray-500">USD</span></p>
                            <p class="text-lg font-semibold text-gray-500">≈ $ ${priceCUP} CUP</p>
                            <a href="${whatsappLink}" target="_blank" class="block text-center w-full bg-green-500 text-white font-semibold py-3 px-5 rounded-lg shadow-md hover:bg-green-600 mt-5 transition-colors">Contactar por WhatsApp</a>
                        </div>
                    </div>`;
                }).join('');
            }
            
            const categories = ['all', ...new Set(products.map(p => p.category))];
            filters.innerHTML = categories.map(cat => {
                const isActive = cat === 'all';
                return `<button data-category="${cat}" class="viewer-filter-btn px-4 py-2 rounded-full text-sm font-semibold shadow-sm ${isActive ? 'bg-indigo-600 text-white' : 'bg-white text-gray-700 hover:bg-gray-100'}">${cat === 'all' ? 'Todas' : cat}</button>`;
            }).join('');

            filters.addEventListener('click', e => {
                if(e.target.tagName === 'BUTTON') {
                    document.querySelectorAll('.viewer-filter-btn').forEach(btn => btn.classList.remove('bg-indigo-600', 'text-white'));
                    document.querySelectorAll('.viewer-filter-btn').forEach(btn => btn.classList.add('bg-white', 'text-gray-700'));
                    e.target.classList.add('bg-indigo-600', 'text-white');
                    e.target.classList.remove('bg-white', 'text-gray-700');
                    currentCategoryFilter = e.target.dataset.category;
                    renderViewerProducts();
                }
            });

            renderViewerProducts();
        });
    </script>
</body>
</html>
